import Vue from 'vue';
import { createRouter, createWebHistory } from 'vue-router';
import AdminPage from './views/AdminPage.vue';



Vue.use(VueRouter);

const routes = [
  {
    path: '/admin',
    name: 'admin',
    component: AdminPage,
  },
];

const router = new VueRouter({
  routes,
  mode: 'history',
});

export default router;
